import React from 'react';

const UsersView = ({ users, setCurrentUser }) =>
  users.map(({ idname, image, statusText }) => (
    <div key={id} onClick={setCurrentUser}>
      <p>{name}</p>
      <img src={image} alt='user' />
      <p>{statusText}</p>
    </div>
  ));

export default UsersView;
